import './Pieces.css'
import Piece from './Piece.js'

const Pieces = () => {
    const position = new Array(8).fill('').map(x => new Array(8).fill(''))
    console.log(position);

    position[0][0] = 'rook_w'
    position[3][3 ] = 'rook_b'

    return <div className='pieces'>
        {
            position.map((r,rank) =>
                r.map((f,file) =>
                    position[rank][file]
                        ? position[rank][file]
                        : null
                ))
        }
    </div>
}

export default Pieces
